    {
        for (int i = 0; i < model.showTimes.Count; i++)
        {
            if(model.showTimes[i]==false)
            {
                model.showTimes[i] = true;
                break;
            }
        }

    }

    public   void RemoveTime()
    {

        for (int i = 10; i >=0 ; i--)
        {
            if (model.showTimes[i] == true)
            {
                model.showTimes[i] = false;
                break;
            }
        }



    }

